/**
 * Welcome back! I hope you all
 * have had a great holiday. I
 * had a blast and I'm feeling
 * lazy, fat, and happy. (I've
 * been eating a LOT of holiday
 * sweets - my wife's a great
 * cook and she decided to make
 * all kinds of christmas
 * goodies).
 *
 * So it's back to work for most
 * of us now so I'd like to
 * start the new year by giving
 * you a productivity technique
 * I found. This technique is
 * rare because is both
 * phenomenally powerful and
 * dead simple! It doesn't get
 * much better than this :-)
 *
 * I call it _*Meditation Lite*_
 * and it's a way to instantly
 * get some of the benefits of
 * meditation without all of the
 * hard work!
 */

/**
 * inner-peace-hurry-up.png
 */

/**
 * Everybody today says we've
 * _got_ to meditate. Meditation
 * is said to be a great
 * productivity (and life)
 * enhancer. From my research,
 * meditation promises at least
 * the following benefits:
 *  1. Meditation improves both
 *  physical and emotional
 *  responses to stress.
 *  2. Meditation improves
 *  concentration and focus.
 *  3. Meditation improves self
 *  awareness.
 *  4. Meditation increases
 *  happiness.
 *  5. Meditation benefits
 *  cardiovascular and immune
 *  health.
 */

/**
 * All good stuff and I
 * encourage you to build
 * meditative practice into your
 * daily routine. The benefits
 * are great!
 *
 * I have been meditating for a
 * few years now and generally
 * do a twenty minute session. I
 * find it does help a great
 * deal - *but* - it takes time
 * and effort and I keep
 * skipping sessions for weeks
 * at a time.
 */

/**
 * Then I came across this
 * technique - simple yet
 * effective while still giving
 * a number of the benefits of
 * meditation in just a few
 * minutes!
 *
 * I now use this technique a
 * couple of times a day (while
 * continuing to meditate
 * whenever I can).
 *
 * This technique is the result
 * of the the amazing work done
 * by [href=https://www.youtube.com/watch?v=q06YIWCR2Js](Dr. Alan Watkins). He
 * presents it in this TedX
 * talk - a talk you *have to*
 * watch if you have the time
 * (and even if you don't!).
 *
 * The video is a little
 * long-ish so I will explain
 * the technique and how you can
 * use it below.
 */

/**
 * puffer-fish.png
 */

/**
 * Almost everyone, when they
 * start with meditative
 * practice will do some version
 * of "breathing meditation" -
 * _counting breaths_, _mindful
 * breathing_, _breath awareness_,
 * and so on.
 *
 * Breath is, in fact, the
 * simplest way to begin
 * meditation practice. After
 * all, as long as you are alive
 * you have breath and you
 * need no props or anything
 * complicated.
 *
 * Because of this, I assumed
 * (as do many of us), that
 * _the focus on breathing is
 * simply a convinient way of
 * beginning meditative
 * practice_.
 *
 * This idea stayed with me
 * until I heard Dr Alan Watkins
 * talk.
 * *_It turns out that
 * _*breathing*_, (not  _*focus*_),
 * leads to most of the benefits
 * we want from meditative
 * practice._*
 *
 * I will give you, in his own
 * words, the insights that lead
 * into the technique of
 * _*Meditation Lite*_.
 */

/**
 * alan-watkins.png [href=https://www.youtube.com/watch?v=q06YIWCR2Js]
 */

/**
 * *Key points from the video*:
 *
 * "If you want to control your
 * physiology this isn't years
 * and years of practice...you
 * don't have to be a yogic
 * master to control your
 * physiology you just have to
 * know *exactly* what to do"
 *
 * "There are twelve different
 * aspects of your breaths you
 * can regulate...for example
 * there is a yogic practice
 * where they teach alternate
 * nostril breathing. That's
 * interesting but that's number
 * nine in the list of
 * priorities..."
 *
 * *_The single most important
 * thing is rhythm_*
 *
 * "...as you can see Neil's
 * physiology has changed from
 * erratic to this coherent
 * waveform in less than a
 * minute when he knows what to
 * do..."
 *
 * *_Once you've got rhythmic
 * breathing going the second
 * most important thing is
 * smoothness_*
 *
 * "You could be breathing
 * rhythmically but stacatto but
 * what you want is is a smooth
 * (fixed volume per second)
 * around the entire cycle"
 *
 * *_And the third most important
 * thing is the location of your
 * attention while breathing.
 * Breath through the center of
 * your chest._*
 *
 * "You put your attention on
 * the center of your chest for
 * three reasons:
 *  1. Dropping your attention
 *  down from your brain gets
 *  you out of all the "noisy
 *  thoughts" in your head.
 *  2. A lot of positive
 *  emotions are experienced
 *  around the center of the
 *  chest. The awareness is in
 *  the mind but the sensation
 *  is in the center of the
 *  chest. So this gives you a
 *  slight positive boost.
 *  3. The heart generates more
 *  electrical power (about 5000
 *  times more electromagnetic
 *  energy than the brain). When
 *  doctors measure brain waves
 *  they have to mathematically
 *  remove the overlaying
 *  heartbeat because it is just
 *  so much stronger. So the
 *  heart does have a good deal
 *  of influence on our system
 *  as a whole."
 */

/**
 * *Meditation Lite* can be
 * summed up as follows:
 *
 * *__B.R.E.A.T.H.E =
 * Breath
 *  Rhythmically
 *   Evenly
 *    And
 *     Through (the)
 *      Heart
 *       Everyday__*
 */

/**
 * Of course we aren't going to
 * get _all_ the benefits of
 * meditation with this practice
 * but *Meditation Lite* will:
 *  1. Help beat the blues
 *  (reduce stress, anxiety, and
 *  depression)
 *  2. Improved focus (memory
 *  and attention)
 *  3. Improved cardio-vascular
 *  and immune health.
 *
 * All for a couple of minutes
 * of a fantastically simple
 * practice! In my opinion there
 * isn't a better deal than
 * this.
 */

