/**
 * [=] Show a mediation lite
 * animation randomly and return
 * [ ] Put an overlay to hide
 * the page
 * [ ] Pick a random animation
 * [ ] Show animation
 * [ ] After animation ends, remove
 * the overlay and show the page
 * again
 * TODO: Multiple Animations
 * [....]
 * This is my first time doing
 * an animation and it took
 * longer than I planned for. I
 * may add animations later if I
 * feel like it but for now,
 * this is useful enough.
 */
function show() {
    var overlay = create_overlay();
    var anim = pick_random_anim();
    show_anim(anim, overlay, function() {
        remove_overlay(overlay);
    });
}

/* [=] Lay an overlay on the page
 * [ ] Create an overlay div
 * that covers the page and is
 * positioned in front (z-index)
 * [ ] Tween the overlay from
 * transparent to displayed.
 */
function create_overlay() {
    var overlay = document.createElement("div");

    overlay.style.position="fixed";
    overlay.style.left = 0;
    overlay.style.top = 0;
    overlay.style.zIndex = 1;
    overlay.style.margin = "0";
    overlay.style.padding = "0";
    overlay.style.width = "100%";
    overlay.style.height = "100%";
    overlay.style.backgroundColor = "rgb(255,255,255)";
    overlay.style.visibility = "hidden";

    document.body.appendChild(overlay);

    TweenMax.to(overlay, 0.3, {
        autoAlpha: 1,
        ease: Circ.easeInOut
    });

    return overlay;
}

/* [=] Remove the overlay
 * from the page
 */
function remove_overlay(overlay) {
    document.body.removeChild(overlay);
}

/* [=] Take an SVG description
 * string and return a svg DOM
 * node.
 * [+] Use the browser to parse
 * the SVG string by setting the
 * `innerHTML` method of a new
 * element. If it parses
 * correctly the first (and
 * only) element will be the
 * SVG.
 * [+ -] If the SVG string is
 * incorrect the parsing will
 * fail. This is acceptable in
 * this scope.
 */
function get_svg_elem(svg_string) {
    var div = document.createElement('div');
    div.innerHTML = svg_string;
    return div.firstChild;
}

